import React from 'react';
import { Link } from 'react-router-dom';
import { useHistory } from 'react-router-dom';
import { useOktaAuth } from '@okta/okta-react';

const Home = () => {
  const history = useHistory();
  const { oktaAuth, authState } = useOktaAuth();

  if (authState.isPending) return null;

  const login = async () => history.push('/login');
  
  const logout = async () => oktaAuth.signOut();

  const button = authState.isAuthenticated ? 
    <button type="button" className="btn btn-sm btn-warning float-right " onClick={logout}>Logout</button> :
    <button type="button" className="btn btn-sm btn-warning float-right " onClick={login}>Login</button>;

  return (
    <div>
      <Link to='/AdminPage'>Home</Link><br/> 
      <Link to='/protected'>Protected</Link><br/>
      <Link to='/UserInt'>User-Database</Link>
      {button}
    </div>
  );
};
export default Home;
